import React from 'react';
import { Col, Container, Row, footer } from "react-bootstrap";
// import './Footer.css';

const Footer = () => {
  return (
    <footer color="blue" className="font-small pt-4 mt-4">
      <div className="footer-copyright d-flex align-content-end flex-wrap text-center py-3">
        <Container fluid>
          &copy; {new Date().getFullYear()} Copyright: <a href="https://www.legalengine.co.kr"> legalengine.co.kr </a>
        </Container>
      </div>
    </footer>
  );
}

export default Footer;
